//Katastar App
window.KatastarApp = function(customCfg) {
	this.filtrirajPodatke = function( $podaci ) {
		var $podaci = $('body').find('[background="images/podloga_ne_isprava.gif"]'),
			$vlasnikRetci = $podaci.children().first().find('tr').not(':first, :last'),/*.children().filter(':eq(0), :eq(1)')*/
			$kcRetci = $podaci.children().last().find('tr').not(':first, :last, :eq(-2)'),
			posjedovni = $('.arial18px > strong').text().split(' ').pop();

		posjedovni

		var	vlasnici = [],
			kc = [];

		$vlasnikRetci.each(function(index, row) {
			var $stupci = $(row).children('td');

			vlasnici.push({
				brojPosjedovnog: posjedovni,
				dio: $stupci.eq(0).children('div').html(),
				posjednik: $stupci.eq(1).html(),
			});
		});

		$kcRetci.each(function(index, row) {
			var $stupci = $(row).children('td');

			kc.push({
				kcBroj: $stupci.eq(2).find('a').text(),
				brojPlana: $stupci.eq(3).html(),
				adresaKc: $stupci.eq(4).html(),
				nacinUporabe: $stupci.eq(5).html(),
				povrsina: $stupci.eq(6).find('a').text(),
				posebniRezimi: $stupci.eq(7).html(),
				primjedba: $stupci.eq(8).html()
			});
		});

		var sveZajedno = [],
			brojRedaka = vlasnici.length > kc.length ? vlasnici.length : kc.length;

		for ( var index = 0; index < brojRedaka; index++ ) {
			var spojeno = $.extend({
					brojPosjedovnog: "",
					dio: "",
					posjednik: "",
					oib: "",
					zgr: "",
					dio2: "",
					kcBroj: "",
					brojPlana: "",
					adresaKc: "",
					nacinUporabe: "",
					povrsina: "",
					posebniRezimi: "",
					primjedba: ""
				}, vlasnici[index], kc[index]);

			//Filtriranje neeljenih znakova
			$.each( spojeno, function( key, value ) {
				spojeno[key] = value
								.replace(/\\n\\r/g, '')
								.trim()
								.replace('&nbsp;', '');
			});

			sveZajedno.push( spojeno );
		}
		return sveZajedno;
	};

	this.izradiTablicu = function( objectArray ) {
		if ( !objectArray || objectArray.length == 0 ) {
			console.error('Could not draw table, objectArray is empty');
			return;
		}

		var $table = $('<table>').attr('id', 'tablica'),
			$tbody = $('<tbody>').appendTo( $table ),
			$header = $('<tr>').appendTo( $tbody );

		//Crtanje zaglavlja
		$.each( objectArray[0], function( key, value ) {
			$header.append( $('<td>').html(key) );
		});

		//Crtanje redaka
		$.each( objectArray, function( index, object ) {
			var $row = $('<tr>').appendTo( $tbody );

			$.each( object, function( index2, value) {
				$row.append( $('<td>').html(value) );
			});
		});

		return $table;
	};

	this.izradiCsv = function(arrayObjekata) {
		if ( !objectArray || objectArray.length == 0 ) {
			console.error('Could not generate .CSV, objectArray is empty');
			return;
		}
		var retci = [],
			zaglavlja = [];

		$.each( arrayObjekata[0], function( key, value ) {
			zaglavlja.push(key);
		});

		retci.push( zaglavlja.join(',') );

		$.each( arrayObjekata, function( index, objekt ) {
			var redak = [];

			$.each( objekt, function(rbr, vrijednost) {
				redak.push(vrijednost);
			});

			retci.push( redak.join(',') );
		});

		window.csv = retci.join('\n');
		copy(csv);
	};

	this.izradiXlsx = function( $table ) {
		if ( !$table || $table.length == 0 ) {
			console.error('Ne mogu generirati XLS, nemam podataka!');
			return;
		}

		var sheet = [];
		sheet.name = 'mySheet';

		$table.find('tr').each(function(rowIndex, row) {
			var rowArray = [];

			$(row).find('td').each(function(colIndex, col) {
				rowArray.push( $(col).text() );
			});

			sheet.push(rowArray);
		});

		var file = {
				worksheets: [ sheet ], // worksheets has one empty worksheet (array)
				creator: 'No name',
				created: new Date(),
				lastModifiedBy: 'No name',
				modified: new Date(),
				activeWorksheet: 0
			};

		return xlsx(file).href();
	};

	this.prikaziRezultatePreuzmiXls = function( $table ) {
		if ( !$table || $table.length == 0 ) {
			console.error('Could not download XLS, $table is empty');
			return;
		}

		var file = this.izradiXlsx($table);
		var href = xlsx(file).href();

		$('#odgovor').html($table);
		window.location.href = href;

		return href;
	};
};

